import React, { Component } from 'react';
import { Input, Menu } from 'semantic-ui-react';

const Navbar = props => {
	return (
		<Menu secondary>
			<Menu.Menu position='right'>
				<Menu.Item name='لوگو' />
				<Menu.Item name='messages' />
				<Menu.Item name='friends' />
			</Menu.Menu>
			<Menu.Item name='logout' />
		</Menu>
	);
};

export default Navbar;
